  //         return (<Theme1Bg data={data} id={id}/>)
  //     } else {
  //         return(<Theme1 data={data} id={id}/>)
  //     }
  // }
  // else if (theme == "Dark") {
  //     if(data.BackgroundImage) {
  //         return(<Theme2Bg data={data} id={id} />)
  //     } else {
  //         return(<Theme2 data={data} id={id}/>)
  //     }

  // }
};
export default Theme;
